import { useCallback, useEffect, useState, useRef } from "react";
import { NavLink,useNavigate } from "react-router-dom";
import { useSpring, animated } from "@react-spring/web";
import { signInWithEmailAndPassword } from 'firebase/auth';
import { auth } from './firebase';
import "./Login.css";

const Login = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [errorMsg, setErrorMsg] = useState('');

    const onLogin = (e) => {
        e.preventDefault();
        setErrorMsg(''); // Clear error messages before attempting login.

        if (!email || !password) {
            setErrorMsg('Please fill in all fields!');
            return;
        }

        signInWithEmailAndPassword(auth, email, password)
            .then((userCredential) => {
                const user = userCredential.user;
                console.log(user);
                navigate('/'); // Redirect to home page on success.
            })
            .catch((error) => {
                console.error(error.code, error.message);
                setErrorMsg('Error! Invalid credentials. Please try again.');
            });
    };

    return (
        <main className="login-page">
            {/* Header Section */}
            <div className="header">
                <div className="results-container">
                    <div className="nav-item" onClick={() => navigate('/')}>
                        ADHDR
                    </div>
                </div>
                <div className="results-container">
                    <div
                        className={`nav-item ${
                            window.location.pathname === '/your-results' ? 'nav-item-active' : ''
                        }`}
                        onClick={() => navigate('/your-results')}
                    >
                        Your Results
                    </div>
                </div>
                <div className="resources-container">
                    <div
                        className={`nav-item ${
                            window.location.pathname === '/adhd-resources' ? 'nav-item-active' : ''
                        }`}
                        onClick={() => navigate('/adhd-resources')}
                    >
                        ADHD Resources
                    </div>
                </div>
                <div className="contact-container">
                    <div
                        className={`nav-item ${
                            window.location.pathname === '/contact' ? 'nav-item-active' : ''
                        }`}
                        onClick={() => navigate('/contact')}
                    >
                        Contact Us
                    </div>
                </div>
                <div className="contact-container">
                    <div
                        className={`nav-item-active ${
                            window.location.pathname === '/login' ? 'nav-item-active' : ''
                        }`}
                        onClick={() => navigate('/login')}
                    >
                        Login or Sign Up
                    </div>
                </div>
            </div>

            {/* Login Section */}
            <section className="login-container">
                <div className="login-box">
                    <h1 className="login-title">Login</h1>
                    {errorMsg && <p className="error-msg">{errorMsg}</p>}

                    <form onSubmit={onLogin} className="login-form">
                        <div className="input-group">
                            <label htmlFor="email-address" className="input-label">
                                Email address
                            </label>
                            <input
                                id="email-address"
                                name="email"
                                type="email"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                required
                                placeholder="Enter your email"
                                className="input-field"
                            />
                        </div>

                        <div className="input-group">
                            <label htmlFor="password" className="input-label">
                                Password
                            </label>
                            <input
                                id="password"
                                name="password"
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                required
                                placeholder="Enter your password"
                                className="input-field"
                            />
                        </div>

                        <button type="submit" className="login-button">
                            Login
                        </button>
                    </form>

                    <p className="signup-text">
                        No account yet?{' '}
                        <NavLink to="/signup" className="signup-link">
                            Sign up
                        </NavLink>
                    </p>
                </div>
            </section>
        </main>
    );
};

export default Login;
